.log-detail-modal {
  >>> .el-dialog__body {
    padding: 0 !important;
  }
  .log-detail-board {
    display: flex;
    height: 550px;
    .log-left-board {
      width: 270px;
      height: 100%;
      overflow-y: auto;
      border-right: 1px solid #d9d9d9;
      .active {
        background-color: #bae7ff !important;
      }
      .item-box {
        padding: 8px 20px;
        cursor: pointer;

        &:hover {
          background-color: #f5f5f5;
        }
        .top {
          display: flex;
          align-items: center;
          .fullName {
            flex: 1;
            min-width: 0;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
            font-size: 16px;
          }
          .icon {
            width: 28px;
            height: 28px;
            border-radius: 50%;
            padding: 5px;
            text-align: center;
            color: #fff;
            transform: scale(0.65);
          }
          .icon-ym-fail {
            background-color: #ff4d4d;
          }
          .icon-ym-success {
            background-color: #55d187;
          }
        }
        .bottom {
          display: flex;
          align-items: center;
          .icon-ym-btn-refresh {
            color: #1890ff;
          }
        }
        .pr-4px {
          padding-right: 4px;
        }
      }
    }
    .log-center-board {
      width: 100%;
      padding: 15px 20px;
      .top {
        display: flex;
        align-items: center;
        justify-content: space-between;
      }
      .time-box {
        padding: 20px 0;
        display: flex;
        span {
          flex: 1;
        }
      }
      .mb-10px {
        margin-bottom: 10px !important;
      }
    }
  }
}
